// src/components/CarouselComponent.js
import React from 'react';
import { Carousel } from 'react-bootstrap';

const CarouselComponent = () => {
  return (
    <Carousel>
      <Carousel.Item>
        <img src="events.jpg" alt="Slide 1" className="d-block w-100" />
      </Carousel.Item>
      <Carousel.Item>
        <img src="disco.jpg" alt="Slide 2" className="d-block w-100" />
      </Carousel.Item>
      <Carousel.Item>
        <img src="coparate.webp" alt="Slide 3" className="d-block w-100" />
      </Carousel.Item>
    </Carousel>
  );
};

export default CarouselComponent;
